window.bookSummaryJSON = "<p><b>With one touch of the stone, Tyron receives his Class and his life changes forever.</b></p> <p>In an instant his bright and promising future as the scion of two powerful Slayers is torn apart and he must make a decision.</p> <p>Will he allow his Class to be purged from his soul, or will he cling to it, abandon all that he knows, and rise to power?</p> <p><b>Don't miss the start of the next hit LitRPG series from RinoZ, the author of </b><b><i>Chrysalis</i></b><b>. </b><b><i>Book of the Dead</i></b><b> takes on all aspects of Necromancy headfirst, from the tactical maneuvering of skeletons, to what it's like spending so much time among the undead.</b></p>"; 
